window.bookSummaryJSON = "<p><b>What if everything you'd fought for was a lie?</b></p> <p>Just when it seemed I'd overcome the biggest obstacles my fae mates and I could face, I find myself in the hands of their greatest enemies. Enemies who have more power than we ever imagined.</p> <p>Enemies who hold so much more sway over my life than I want to believe.</p> <p>I have to escape, and not just to warn the men I love and defend the home I've made with them. The longer I remain, the more these villains can use me to destroy everything I care about.</p> <p>If I fail now, the entire faerie world will crumble. I don't know if I can do it alone - but where will I find an ally among the cruelest of the fae?</p> <p><i>Lies of Murk</i> is the seventh book in Bound to the Fae, a new paranormal romance series featuring possessive shifters, dangerous fae politics, and a wounded heroine finding her strength.</p>"; 
